import React, { Component } from 'react';
import './Header.css';
import {Navbar, Nav, NavDropdown, Container, Form, FormControl, Button, Text} from 'react-bootstrap';

const Header = () => {
    return (
  <Navbar className="color-nav" expand="lg">
    <Container class='navBar'>
      <Navbar.Brand href="#home">
        <img src={require('./src/DomusLogo.png')} alt='logo' class='logo'/>
     </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Nav className="me-auto">
        <Nav.Link href="#home">Inicio</Nav.Link>
        <Nav.Text> | </Nav.Text>
        <Nav.Link href="#link">Propiedades</Nav.Link>
        <Nav.Text> | </Nav.Text>
        <Nav.Link href="#link">Quienes somos</Nav.Link>
          <Button className="position-absolute top-1 end-0">Iniciar Sesion</Button>
      </Nav>
      </Container>
  </Navbar>
  );
}

export default Header;

//export 'default' (imported as 'Header') was not found in './Componentes/Header.jsx' (module has no exports)
